import React from 'react';

class Login extends React.Component{

  render(){

    return (
      <div className="login">
        <form>
          <label>
            Blizzard User Name
          </label>
          <input name="username"></input>
          <label>
            Blizzard Password
          </label>
          <input name="passwprd"></input>
        </form>
      </div>
    );

  }

}

export default Login;
